import logo from './logo.svg';
import './App.css';

function App() {
  return (
    //Isto é um JSX
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1 className="titulo">
          Edita o arquio App.js p teu pai <code>src/App.js</code> and save to reload.
        </h1>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
